import screenS from "../../assets/images/screen.png"

export const styled = (theme) => ({
    gridBooking: {
        padding: "15px",
    },
    choiceChair: {
        color: "#6645fd",
        "&:hover": {
            color: "#6645fd",
        },
    },
    pading: {
        padding: theme.spacing(2),
    },
})

export const screenCinema = () => ({
    images: screenS
})
